import React from "react";
import student from "../../assets/360_F_173136576_AdvkB7t3tsvwziIe4Wch5kUUkCddxjHx__1_-removebg-preview.png";
import "../../styles/about/about.css";
import buble from "../../assets/blob-haikei2.png";

const About = () => {
	return (
		<div className="about__container">
			{/* <h1 className="title">About me.</h1> */}
			<div className="blob">
				<img src={buble} alt="" />
			</div>
			<div className="row_me">
				<div className="img_container">
					<img src={student} alt="" className="about_img" />
				</div>
				<div className="about_msg">Hello</div>
			</div>
			<div className="row_sketch"></div>
		</div>
	);
};

export default About;
